101 Cozy Casserole Recipes Cookbook by Gooseberry Patch 
2012 | ISBN: 1612810551 | English | 112 pages | EPUB | 7 MB

Who doesn't love a good casserole? Hot and bubbly, topped with melting cheese or golden crumbs, casseroles are the very definition of comfort food. They're super-simple to prepare...just pop it in the oven and out comes a hearty dish the whole family will love. 101 Cozy Casseroles is packed with tried &amp; true recipes that will have a scrumptious dinner on the table in a snap.
Your family is sure to love tasty classics like Eggplant Parmesan, Supreme Pizza Casserole and Famous White Mac &amp; Cheese. There's even potluck-sized recipes like Hearty Breakfast Casserole, Baked Chicken Jambalaya and Cabbage Roll Casserole. All are sure to be a hit at your next get-together! And with each recipe there's a beautiful, full-color photo to get your taste buds tingling. 101 Cozy Casseroles is sure to become an instant favorite that you'll revisit time and time again.
